import React from 'react';
import '../styles/Home.css';
import { Helmet } from 'react-helmet';

class Home extends React.Component {
  render() {
    return (
      <div className="home-container">
        <Helmet>
          <title>Techbitz.io | Elevate Your Business with Comprehensive Digital Solutions</title>
          <meta name="description" content="Techbitz.io provides expert web design and development, digital marketing, SEO services, testing services, and advertising. Empower your business growth with us." />
        </Helmet>
        <div className="hero-banner">
          <h1>Unleash Your Business Potential with Techbitz.io</h1>
        </div>
        <div className="content">
          <p>Welcome to Techbitz.io - your one-stop solution for end-to-end digital services. We offer professional web design and development, innovative digital marketing strategies, comprehensive testing services, and impactful SEO solutions. Our mission is to help businesses of all sizes to realize their digital potential, increase visibility, and drive success online.</p>
        </div>
      </div>
    );
  }
}

export default Home;
